  return (
    <>
    <div className="app">
      <h1>Hi there!</h1>
    </div>
      <Navbar/>
      <Create/>
      <FindOne/>
      <Home/>
      <Index/>
      <About/>
      <ShowOne/> 
    </>
  );
}

export default App;
